import React from "react";

import "./Track.css";

class Track extends React.Component {
  renderAction() {
    if (this.props.isRemoval) {
      return <button className="Track-action">-</button>;
    } else {
      return <button className="Track-action">+</button>;
    }
  }

  render() {
    return (
      <div className="Track">
        <div className="Track-information">
          <h3>name</h3>
          <p>artist | album</p>
        </div>
        {this.renderAction()}
      </div>
    );
  }
}

export default Track;
